fn approximate_match_positions(pattern: &str, genome: &str, max_hamming_distance: usize) -> Vec<usize> {
    let mut positions = Vec::new();
    let limit = genome.len() - pattern.len() + 1;

    for pos in 0..limit {
        let slice = &genome[pos..pos + pattern.len()];
        if hamming_distance(pattern, slice) <= max_hamming_distance {
            positions.push(pos)
        }
    }
    positions
}

fn hamming_distance(string1: &str, string2: &str) -> usize {
    let mut distance = 0;
    for (c1, c2) in string1.chars().zip(string2.chars()) {
        if c1 != c2 {
            distance += 1
        }
    };
    distance
}

fn find_min_skew(genome: &str) -> Vec<usize> {
    let mut skew: isize = 0;
    let mut min_skew: isize = 0;
    let mut min_positions = vec![0];

    for (position, base) in genome.chars().enumerate() {
        match base {
            'G' => { skew += 1; },
            'C' => { skew -= 1; },
            _ => {}
        };
        if skew == min_skew {
            min_positions.push(position + 1);
        } else if skew < min_skew {
            min_skew = skew;
            min_positions = vec![position + 1];
        };
    };
    min_positions
}

fn find_pattern_clumps(genome: &str, kmer_size: usize, window_length: usize, min_occurrences: usize) -> Vec<&str> {
    if kmer_size == 0 || kmer_size > window_length || kmer_size > genome.len() || min_occurrences > genome.len() - kmer_size {
        return vec![]
    }

    let limit = genome.len() - kmer_size + 1;
    let mut kmer_hash: HashMap<&str, Vec<usize>> = HashMap::new();

    for index in 0..limit {
        let kmer = &genome[index..index+kmer_size];
        let mut vec = match kmer_hash.get(&kmer) {
            Some(vec) => vec.clone(),
            None => Vec::new(),
        };
        vec.push(index.clone());
        kmer_hash.insert(&kmer, vec);
    }

    let mut kmers = Vec::new();
    for (key, value) in kmer_hash.iter() {
        if has_clump(&value, kmer_size, window_length, min_occurrences) {
            kmers.push(key.clone());
        }
    }
    kmers
}

fn has_clump(position_vector: &Vec<usize>, kmer_size: usize, window_length: usize, min_occurrences: usize) -> bool {
    let mut queue: VecDeque<&usize> = VecDeque::new();

    for position in position_vector.iter() {
        if let Some(front) = queue.pop_front() {
            if ((position + kmer_size) - front) <= window_length {
                queue.push_front(front);
            };
        };
        queue.push_back(position);
        if queue.len() >= min_occurrences {
            return true
        }
    }
    false
}

fn find_substring_indices(pattern: &str, text: &str) -> Vec<usize> {
    let mut indices: Vec<usize> = Vec::new();

    if text.len() == 0 || pattern.len() == 0 || pattern.len() > text.len() {
        return indices
    }

    let limit = text.len() - pattern.len() + 1;
    for index in 0..limit {
        if &text[index..index + pattern.len()] == pattern {
            indices.push(index);
        }
    }
    indices
}

fn complement_map(char: &char) -> &char {
    match char {
        'A' => &'T',
        'T' => &'A',
        'C' => &'G',
        'G' => &'C',
        _ => panic!("character not in DNA alphabet!")
    }
}

fn reverse_complement(text: &String) -> String {
    let mut reverse = String::new();
    for char in text.chars().rev() {
        let c = complement_map(&char);
        reverse.push(*c);
    }
    reverse
}

fn most_frequent_kmers(text: &String, k: usize) -> Vec<&str> {
    let hash = most_frequent_kmer_hash(text, k);
    let inverted_hash: HashMap<usize, Vec<&str>> = inefficient_invert_hash(hash);

    let mut max_key: &usize = &0;
    for key in inverted_hash.keys() {
        if key > max_key {
            max_key = key;
        }
    }

    let kmers = inverted_hash[max_key].clone();
    kmers
}

